INSERT INTO `answer` VALUES (73,'※ 다른 더 좋은 방법이 있을 수 있습니다.. 참고만 하시길\n```\ndata = {\'a\': [\'asd.fgh\', \'abcd.efg\', \'123.456\']}\ndf = pd.DataFrame(data=data)\ncList = []\ndList = []\nfor idx, row in df.iterrows():\n    charList = row[\'a\'].split(\'.\')\n    cList.append(charList[0])\n    dList.append(charList[1])\ndf[\'c\'] = pd.DataFrame(cList)\ndf[\'d\'] = pd.DataFrame(dList)\nprint(df)\n#           a     c    d\n# 0   asd.fgh   asd  fgh\n# 1  abcd.efg  abcd  efg\n# 2   123.456   123  456\n```\n그리고 뒤 늦게 위 코드를 다시 살펴봤는데, 잘 동작하는데요? 이게 저 보다 더 나은 방법 같기도.. ㅎㅎ\n```\ndata = {\'a\': [\'asd.fgh\', \'abcd.efg\', \'123.456\', \'123.456.789\']}\ndf = pd.DataFrame(data=data)\nfor i in range(len(df)):\n    df.loc[i, \'c\'], df.loc[i, \'d\'] = str(df.loc[i, \'a\']).split(sep=\'.\', maxsplit=1)\nprint(df)\n#              a     c        d\n# 0      asd.fgh   asd      fgh\n# 1     abcd.efg  abcd      efg\n# 2      123.456   123      456\n# 3  123.456.789   123  456.789\n```','2021-08-19 10:32:31.467871',0,56,'8HK63Z9CSQW10'),(78,'좋은 정보 감사합니다!','2021-08-19 10:43:56.079306',0,57,'8HK63Z9CSQW10'),(89,'## Java와 JavaScript의 차이점\n두 언어는 완전히 다른 언어이다.\n\n이름은 비슷하지만 둘은 완전 다르다.\n\nex. 햄과 햄스터, 인도와 인도네시아\n\n### Java는 Server용 언어\n다른 언어와 다르게 컴파일된 코드가 플랫폼 독립적이다.\n\n무슨 뜻이냐면, CPU나 운영체제의 종류에 관계없이 어디서나 실행 가능하다.\n\nC를 비롯한 다른 언어들은 플랫폼마다 다르게 개발해야 한다.\n\n\"자바로 만들지 못하는 프로그램은 없다\"\n\n변수 자료형이 반드시 선언, 컴파일 과정을 거친다.\n\n### JavaScript는 Client용 언어\n\"웹사이트에 생명을 불어 넣어주는 마법의 언어\"\n\n이 JavaScript를 이용해 웹 페이지를 동적으로 바꿔준다.\n\n이 JavaScript를 웹 브라우저 밖으로 꺼내준 Node.js\n\n변수 자료형을 미리 선언하지 않아도 브라우저가 자동으로 파악\n\n컴파일 과정을 거치지 않는다.','2021-08-19 11:01:43.510879',0,55,'629Q0LC8H2OC7'),(90,'자바의 배열은 레퍼런스로 전달됩니다. 작성하신 코드는 하나의 배열에 대해 오름차순 정렬 후 다시 내림차순 정렬하기 때문에 내림차순 결과만 출력됩니다.\n\n다시말해 arr, ascSortedArr, decSortedArr 은 같은 배열을 바라보고 있습니다.\n\n아래처럼 출력 순서를 바꿔보시면 의도하신대로 출력될꺼에요.\n```\n        int[] ascSortedArr = new int[100];\n        ascSortedArr = ascBubbleSort(arr);\n        for(int j = 0; j &lt; arr.length; j++) {\n            System.out.println(ascSortedArr[j]);\n        }\n        int[] decSortedArr = new int[100];\n        decSortedArr = decBubbleSort(arr);\n        for(int j = 0; j &lt; arr.length; j++) {\n            System.out.println(decSortedArr[j]);\n        }\n```','2021-08-19 11:02:43.410913',0,60,'629Q0LC8H2OC7'),(92,'\n재귀호출에 대해 다시 이해하면 좋을 것 같네요.\n\nhttps://www.youtube.com/watch?v=Mga1rElzrVo\n\nhttps://marobiana.tistory.com/79','2021-08-19 11:04:12.077513',0,62,'629Q0LC8H2OC7'),(93,'자바스크립트 기반으로 프론트쪽 기술 스택을 쌓으셨다면 백엔드도 자바스크립트로 가져가시는게 아무래도 좋아 보입니다. 자바스크립트로 백엔드 하시려면 nodeJS 공부하시면 됩니다. 요즘 트렌드는... 입문에 장벽이 있긴 하지만 자바 스프링이 제일 많이 쓰이고, 최근에는 파이썬 장고도 자주 보이더라구요. 그 외에 루비온레일즈, JSP, PHP, ASP.Net 등 백엔드 기술들이 있습니다.\n\n완전히 새로운 기술을 처음부터 새로 배워나가는 건 분명 어려움이 있을 겁니다. 본인의 기술 스택을 정리해보고 활용, 연계할 수 있는 언어들을 기반으로 확장해나가는게 바람직합니다.','2021-08-19 11:04:42.797808',0,61,'629Q0LC8H2OC7'),(98,'가장 좋은 방법은 data가 외부에서 읽어질 필요가 없도록 설계 하는 것입니다.  \n차선으로는 또 다른 thread에서 data가 null이 아닐때 까지 watch 하면서 대기하는 방법이 있어요!!','2021-08-19 11:10:11.592409',0,69,'ZBBEE3OA3N89L'),(102,'재귀함수는 말이죠 \n\n자신을 호출할때마다 새로운 스택공간을 창조하고 거기에 함수의 지역변수를 만들어 사용하므로 자신을 호출한 전단계의 지역변수값과 아무런 연관도 없답니다. \n\n그래서 전단계의 계산결과가 초기화되는 일은 없을거예요.\n그리고 재귀호출후 출력하는것은 2진수를 구하는 공식 그대로죠.','2021-08-19 11:17:23.208951',0,62,'8HK63Z9CSQW10'),(104,'운용 목적에 따라 리눅스가 다재다능하게 활용될 수 있겠죠.\n\n로컬에서 작업한 뒤 리눅스 서버에 배포하여 활용하는, 일반적인 웹서버의 역할로도 사용할 수 있을 것이고... 리눅스 GUI 환경에서 IDE 설치한 후 개발 진행해도 될 것이고... 리눅스 CLI 환경에서 vim으로 개발 진행해도 될 것이고...\n\n어떤 방법이든 다 한 번씩은 시도해보시는 것을 추천드립니다! 리눅스는 도구이기 때문에, \'리눅스를 OS로 두고 개발을 한다는 것\'이라는 문장 단어 하나하나에 집중하지 마시기 바랍니다. 질문에서 말씀하신 어느 방법이든 다 괜찮습니다 ㅎㅎ\n\n말씀하신 방법들을 하나씩 해보다보면... 앞으로 어떻게 리눅스를 활용해야 할지, 특정 상황에서 어떤 방식을 이용해야 할 지 감이 잡히실 겁니다. 열공하세요!','2021-08-19 11:18:37.422057',0,74,'W963651S7589J'),(106,'```\nSystem.out.println(\"학생수를 입력하시오\");\nnum = scan.nextInt();\n```\n여기서 학생수를 num 변수에 받았으니, 이 값을 사용해서 score 배열 크기를 할당하면 됩니다.\n```\n//int score[] = {0};\nint score[] = new int[num]\n```\n이렇게 수정하면 되겠습니다.','2021-08-19 11:20:50.809860',0,73,'629Q0LC8H2OC7'),(107,'위 소스를 제가 돌려본 게 아니라서 자세하게는 답변 드리기 어렵지만, 대강 읽어만 보자면,문제는 int gamers_num에 있습니다.\n\n로직이 전체적으로 gamers_num의 값을 기준으로 for를 돌고 게임 진행이 가능한지 체크하고 그러고 있거든요. 그러다가도 어느 시점에서는 player[i]를 \"탈락\"시키려고 시도합니다. 그나마도 실제로 일어나는 일은 player[i]가 player에서 사라지는 것이 아니고 단지 gamers_num--;뿐이거든요. 다시 말하면... 해당 플레이어가 정말로 링에서 내려오는 일은 없고, 단지 전광판 숫자만이 바뀌고 있는 것 같다 이 말입니다.\n\n자바는 잘 몰라서 구체적인 코드 작성은 못하겠지만, 저보고 다시 짜라고 하면 getNextPlayer(currentPlayer) 메소드를 하나 정의해서 처리하겠습니다. 이 메소드가 Player 인스턴스를 반환할 경우에는 그 인스턴스에 대해서 뭔가 할 수 있을 테고, null이라면 break를 걸면 되겠지요. 그리고 getNextPlayer() 메소드는, 지금 링 위에 올라와 있는 선수가 누구누구인지 인자로 받은 currentPlayer가 링 위에 있는지 그렇다면 다음 선수는 누구인지 그런 거만 전담해서 판별하고 반환하는 메소드가 될 테구요.\n\n참고가 되면 좋겠네요.','2021-08-19 11:21:52.405086',0,76,'ZP4XBO036G25W'),(108,'기본적으로 리눅스에서 뭔가를 개발한다 뭔가를 서비스 한다는것은 리눅스를 알기 이전에 서비스를 하는 서버라는게 뭔지에 대해서 우선적으로 이해를 하는게 좋습니다. 일반적으로 우리가 사용 하는 서버라고 하는 것은 뭔가 철제 렉으로 된 곳에 납작한 하드웨어를 차곡차곡 쌓은 것을 서버로 알고 있습니다.\n\n그러나 서버란 그런 하드웨어적인 분류가 아니고 단순히\n\n\'클라이언트에게 네트워크를 통해 서비스를 하는 컴퓨터\'\n\n로 표현 할 수 있습니다. 그 컴퓨터는 값비싼 클라우드 서버, 단순히 게임용 스펙에 설치된 서버, 그리고 손바닥 만한 크기의 컴퓨터도 서버가 될 수 있다는 겁니다.\n\n별거 아닌거 같지만 일단 이게 생각보다 중요한 개념입니다.\n\n그럼 왜 하필 리눅스냐 라고 생각하신다면 아래와 같은 이유가 좀 있습니다.\n\n리눅스를 사용 하는 이유\n\n무료(서비스를 하기 위한 같은 스펙의 윈도우 서버는 비용이 어마어마하게 비쌉니다.) 기본적인 높은 하드웨어 퍼포먼스.(어지간한 오래된 컴퓨터 메모리 1기가 짜리 컴퓨터도 무난하게 잘 돌아갑니다.) 용도에 맞는 다양한 배포판 리눅스로 인해 선택의 폭이 커짐.(이건 좀 나중의 얘기입니다.) 커널부터 모든 OS 소스가 오픈 소스라서 본인이 원하지 않는(혹은 최적화를 하기 위해서) 가볍게 커스텀 가능.(실제로 어마어마한 업체가 이렇게 씁니다. ex : Amazon Linux, android) 다양한 배포판, 복잡한 파일관리 시스템, 기타 등등 때문에 악성코드(실제로 악성코드 대부분이 windows 타겟팅이 강합니다.)로 부터 다소 안전함.(그래도 털릴 서버는 다털림 ㅠㅠ) 이상 그 외에도 등등이 있습니다.\n\n리눅스를 OS로 두고 개발한다는게 상상이 안되신다는게 무슨 말씀인지 이해가 됩니다. 다만 지금 윈도우 환경에서 개발하고 있는걸 그냥 리눅스라는 OS에서 한다는 말로 있는 그대로 받아들이기만 하면 됩니다.\n\n리눅스는 윈도우와 같은 그냥 OS일 뿐입니다. 다만 그 표현 방식이 윈도우랑은 좀 다를 뿐입니다.','2021-08-19 11:22:30.051021',0,74,'ZP4XBO036G25W'),(109,'사용자로 부터 지역을 입력받지 않고 바로 날씨를 불러온다면\n\nonCreate에서 바로 API를 호출하고 그 값을 파싱하여 이미지를 표시해도 됩니다.\n\n이 때 imageView를 동적으로 생성해서 리소스를 imageView에 설정 합니다.\n\n만약 API 로딩이 오래걸린다면 먼저 onCreate에서 로딩 이미지를 보여주고 비동기로 API를 호출 한 뒤 이미지를 보여 줄 수도 있습니다.\n\n만약 사용자로부터 지역을 입력 받는다면 먼저 input view를 이용해 값을 입력받은 뒤 onClick 된 후 API 과정을 진행 하면 됩니다.\n\n이처럼 구현에는 다양한 방식이 있고 activity의 라이프사이클에 대한 학습이 먼저 필요합니다.','2021-08-19 11:23:06.260171',0,65,'ZP4XBO036G25W'),(110,'Vue는 현재 활성화된 인스턴스에서 데이터 변경을 관찰하고 이에 반응하는 좀 더 일반적인 방법인 watch 속성을 제공합니다. 다른 데이터를 기반으로 변경해야 하는 데이터가 있는 경우, watch 를 과도하게 쓰고자 하는 유혹이 있습니다. 특히 AngularJS 기반에서 온 경우 그렇습니다. 그러나 명령형 watch 콜백보다 computed 속성을 쓰는 것이 더 나은 경우가 많습니다. watch는 코드를 반복하게 되어 computed를 사용하여 더 간단한 코드를 만들 수 있습니다. 반면에 watch는 데이터 변경에 대한 응답으로 비동기 혹은 비용이 많이 드는 작업을 수행하려는 경우가 가장 유용합니다.\n\n해당 공식문서를 확인해주세요 https://v3.ko.vuejs.org/guide/computed.html','2021-08-19 11:23:17.848824',0,66,'ZP4XBO036G25W'),(111,'```str.split + expand=True 가 가장 간단합니다.```\n```\nPython 3.8.5 (tags/v3.8.5:580fbb0, Jul 20 2020, 15:57:54) [MSC v.1924 64 bit (AMD64)] on win32\nType \"help\", \"copyright\", \"credits\" or \"license()\" for more information.\nimport pandas as pd\ndf = pd.DataFrame({\"a\":[ \"abc,def\", \"eig,esi\", \"333,ee1\"]})\ndf\n         a\n0  abc,def\n1  eig,esi\n2  333,ee1\ndf[\"a\"].str.split(\",\")\n0    [abc, def]\n1    [eig, esi]\n2    [333, ee1]\nName: a, dtype: object\ndf[\"a\"].str.split(\",\", expand=True)\n     0    1\n0  abc  def\n1  eig  esi\n2  333  ee1\ndf[[\"a1\", \"a2\"]] = df[\"a\"].str.split(\",\", expand=True)\ndf\n         a   a1   a2\n0  abc,def  abc  def\n1  eig,esi  eig  esi\n2  333,ee1  333  ee1\n```','2021-08-19 11:26:17.657407',0,56,'9770KR3A401MC'),(113,'위 자바코드와 동일한 의사코드입니다. 어느라인이 어디에 대응되는지 스스로 생각해 보세요.\n```\n이진수로출력(출력할수):                       // 출력할수가 101001 이었다면\n   마지막자리수 = 마지막자리수구하기(출력할수)   // 마지막자리수는             1\n   마지막자리수뺀수 = 마지막자리수떼기(출력할수)  // 마지막자리수뺀수는    10100\n   이진수로출력(마지막자리수뺀수)               // 여기선 윗다섯자리     10100 출력됨.\n   마지막자리수이어서출력(마지막자리수)          // 마지막자리수 불여서        1 출력됨.\n                                           // 결국                101001 이 출력됨.\n```','2021-08-19 11:30:45.148669',0,62,'9770KR3A401MC'),(114,'run에서 return을 하는 방법은 없습니다.   \n run이 비동기 적으로 실행 되므로 data에서 값을 읽으려면 run 된 후에 읽어야 데이터가 표시됩니다.','2021-08-19 11:32:00.583445',0,69,'W963651S7589J'),(115,'감사합니다!!','2021-08-19 11:32:07.039426',0,74,'8HK63Z9CSQW10'),(116,'Exception in thread \"main\" java.lang.ArrayIndexOutOfBoundsException: 1 at javaprac.hello.main(hello.java:19)\n\n상기의 예외 메세지는 배열의 길이가 잘못되어 유효하지 않은 범위를 선택했을때 발생합니다.\n```\njshell int score[] = {0};\nscore == int[1] { 0 }\n```\n코드를 보면 1개짜리 배열을 선언했습니다. 그런 관계로 1명 했을때는 정상적으로 배열에 저장이 될 수 있지만 2명째에는 오류가 발생하게 됩니다.\n\n배열을 늘리던지 배열대신 ArrayList 를 사용하세요.','2021-08-19 11:33:54.227484',0,73,'9770KR3A401MC'),(117,'첫번째로 deque를 사용하지 않으면 해당 문제에서는 시간초과가 발생합니다.\n```\nresult = 0\nfor i in table:\n    for j in i:\n        if j == 0:\n            print(-1)\n            exit(0)\n    result = map(result, max(i))\nprint(result - 1)\n```\n이 부분을 다음과 같이 수정해보세요! 0이 있다면 -1을 출력하고 exit(0)으로 빠져나와야 하고 최댓값 구하기를 2중 for문 안에서 해야합니다.\n```\nans = 0\nfor i in range(M):\n    for j in range(N):\n        a = table[i][j]\n        if a == 0:\n            print(-1)\n            exit(0)\n        ans = max(ans, a)\nprint(ans - 1)\n```','2021-08-19 11:35:04.852243',0,72,'8HK63Z9CSQW10'),(118,'`str.split + expand=True` 를 사용하면 더 간단하게 작동하는군요! 좋은 정보 감사합니다','2021-08-19 11:36:36.046940',0,56,'6OT8072V58Z5N'),(119,'저도 파이썬을 쓰는데 VScode가 제일 편하긴합니다ㅎㅎ 알고리즘 문제 풀 때는 버전 문제로 다운그레이드 된 버전을 Pycham을 적용해서 사용하기도 해요','2021-08-19 11:41:48.626489',0,75,'6OT8072V58Z5N'),(123,'저는 언어는 Java, Ide는 인텔리제이를 사용합니다. 인텔리제이 적극 추천합니다!','2021-08-20 03:33:30.558896',0,75,'8HK63Z9CSQW10');
