INSERT INTO `article` VALUES (266,'FE개발자의 성장 스토리 11 : Electron, 저도 한번 해보겠습니다.','Front End(이하 FE) 개발이라고 하면, 보통 웹(Web) 사이트/페이지 또는 앱을 개발한다고만 생각할 수 있는데요, 오래전부터 Node.js등을 활용해 서버 측 백엔드, PC 프로그램, VR/AR 개발까지 영역을 확장해가고 있습니다.  일렉트론(Electron)을 이용해 GUI 구현과 서버 측 연동으로 데스크톱용','https://tech.kakao.com/2021/08/17/frontend-growth-11/',1,'kakao','2021-08-17 10:28:09'),(267,'Generative Adversarial Networks를 이용한 Nickface 개발','카카오 사내 기술 세미나 Techtalk 여섯 번째 이야기입니다.본 내용은 AI 기술 개발 및 연구를 위함으로 상업적 활동이 아니라는 것을 말씀드립니다.  안녕하세요, 카카오브레인에서 AI 기반 이미지 생성 모델을 연구하고 있는 Orca.na라고 합니다.  유튜브 내에서 활동하는 사람이 늘어나고, 메타버스의 개념이 대두되','https://tech.kakao.com/2021/08/04/nickface/',1,'kakao','2021-08-04 10:10:44'),(268,'[카.올.시.]  Front-End 개발자라면 카카오에 올 시간입니다.','내가 하고 있는 직무가 Front-End라면 주목! 이젠 카카오에 올 시간입니다. 카카오에서 3년 차 이상의 경력자를 대상으로 8월 5일까지 집중 영입을 진행합니다. [공고보기] 무슨 일을 하게 되는지? 어떤 문화를 가지고 있는지? 등 전형을 준비하면서 궁금하실 점이 많으실 것 같아 지난 7월 22일 목요일, 28일 수요','https://tech.kakao.com/2021/07/30/frontend-recruitment/',1,'kakao','2021-07-30 09:26:00'),(269,'[카.올.시.]  Android 개발자라면 카카오에 올 시간입니다.','내가 하고 있는 직무가 Android라면 주목! 이젠 카카오에 올 시간입니다. 카카오에서 3년차 이상의 경력자를 대상으로 8월 5일까지 집중 영입을 진행합니다. [공고보기] 무슨 일을 하게 되는지 ? 어떤 문화를 가지고 있는지? 등 전형을 준비하면서 궁금하실 점이 많으실 것 같아 지난 7월 22일 목요일, 28일 수요일 ','https://tech.kakao.com/2021/07/30/android-recruitment/',1,'kakao','2021-07-30 09:26:00'),(270,'실용주의 데브옵스 for MSA','안녕하세요, 콘텐츠서비스개발팀에서 카카오TV 동영상 빅데이터 수집 및 분석 업무와 동영상 추천 시스템을 개발하고 있는 Knight 라고 합니다. ‘실용주의 데브옵스 for MSA’는 저희가 카카오TV 실서비스를 오픈하기 전에 진행한 데브옵스 시스템 구축에 대한 이야기입니다.  카카오TV가 데브옵스 시스템을 구축하게 된 배','https://tech.kakao.com/2021/07/16/devops-for-msa/',1,'kakao','2021-07-16 10:08:46'),(271,'2021 카카오 인턴십 for Tech developers 코딩 테스트 해설','2021년 카카오의 여름 인턴십의 첫 번째 관문인 코딩 테스트가 지난 2021년 5월 8일에 4시간에 걸쳐 진행되었습니다. 이번 인턴 코딩 테스트에서는 5문제가 출제되었습니다. 이전과 동일하게 쉬운 문제를 앞쪽에, 어려운 문제를 뒤쪽에 배치하였으며, 일부 문제에는 효율성 테스트 케이스를 추가하여 효율적으로 문제를 해결한 ','https://tech.kakao.com/2021/07/08/2021-%ec%b9%b4%ec%b9%b4%ec%98%a4-%ec%9d%b8%ed%84%b4%ec%8b%ad-for-tech-developers-%ec%bd%94%eb%94%a9-%ed%85%8c%ec%8a%a4%ed%8a%b8-%ed%95%b4%ec%84%a4/',1,'kakao','2021-07-08 10:00:37'),(272,'Open Work를 향한 작은 노력들 : 조직의 작은 변화 만들기','카카오 사내 기술 세미나 Techtalk 여섯 번째 이야기입니다. 안녕하세요. 광고개발팀에서 광고계정, 광고빌링을 담당하고 있는 cuddy입니다. 카카오의 일하는 방식인 Open Work가 지향하는 가치들을 달성하기 위해 많은 조직이 Open Work 코칭을 받고 있습니다. 코칭을 통해 많은 배움과 영감을 받지만 결국 우','https://tech.kakao.com/2021/07/05/openwork-cuddy/',1,'kakao','2021-07-05 11:00:24'),(273,'OpenWork, 카카오의 일하는 방식','안녕하세요, 카카오 애자일코치 benedict입니다. 여러분의 팀은 얼마나 열려있으신가요? 더욱더 열린 문화와 열려있는 일하는 방식을 향한 카카오의 지난 여정의 발걸음에서 만들어진 카카오의 일하는 방식인 OpenWork에 대해서 소개하려 합니다. Why Open? 왜 우리의 일들을 오픈해야 할까요? 카카오는 이미 열린 문','https://tech.kakao.com/2021/07/02/openwork-agile/',1,'kakao','2021-07-02 10:15:33'),(274,'카카오 AI추천 : 토픽 모델링과 MAB를 이용한 카카오 개인화 추천','글 작성에는 추천팀 sasha.k와 marv.20가 함께해 주셨습니다. 머신러닝에 대한 기초 지식이 있고, 추천 알고리즘에 관심이 있는 분들에게 카카오 추천팀이 개인화 추천 기술을 활용하는 방법에 대해 공유합니다. 우리의 일상 속에는 수많은 추천이 함께합니다. 카카오 추천팀은 카카오가 제공하는 서비스들에서 여러분들이 더 ','https://tech.kakao.com/2021/06/25/kakao-ai-recommendation-01/',1,'kakao','2021-06-25 10:39:42'),(275,'팀 프로젝트가 나에게 남긴 것','안녕하세요. 테크코스교육개발팀 이원미입니다. 우테코 3기도 어느덧 중반을 지나고 있습니다 : ) 올해는 온라인으로 소통하는 상황이 많아지고, 크루들의 얼굴을 잘 보지 못해서인지 시간이 더욱더 빠르게 흘러가는 것 같아 안타까운데요. 이런 상황 속에서도 본인들이 직접 기획하고 만들어보는 프로젝트 미션을 열심히 진행하면서, 조','https://techblog.woowahan.com/5226/?utm_source=rss&utm_medium=rss&utm_campaign=%25ed%258c%2580-%25ed%2594%2584%25eb%25a1%259c%25ec%25a0%259d%25ed%258a%25b8%25ea%25b0%2580-%25eb%2582%2598%25ec%2597%2590%25ea%25b2%258c-%25eb%2582%25a8%25ea%25b8%25b4-%25ea%25b2%2583-2',3,'woowahan','2021-08-17 13:08:23'),(276,'첫 회사를 우아한형제들에서 시작한 아가 개발자의 걸음마 떼기','배민주문서비스팀 신규 입사자의 파일럿 프로젝트 경험을 공유합니다. 안녕하세요! 6월 21일 배민주문서비스팀에 서버 개발자로 합류하게 된 김경준입니다. 기술 블로그의 글들을 보면서, 언젠간 사람들에게 도움이 될 수 있는 이야기를 공유해야지 꿈만 꾸던 학생이었는데 지금 우아한형제들에 합류하여 글을 적고 있다니..😭 정말 감','https://techblog.woowahan.com/5143/?utm_source=rss&utm_medium=rss&utm_campaign=%25ec%25b2%25ab-%25ed%259a%258c%25ec%2582%25ac%25eb%25a5%25bc-%25ec%259a%25b0%25ec%2595%2584%25ed%2595%259c%25ed%2598%2595%25ec%25a0%259c%25eb%2593%25a4%25ec%2597%2590%25ec%2584%259c-%25ec%258b%259c%25ec%259e%2591%25ed%2595%259c-%25ec%2595%2584%25ea%25b0%2580-%25ea%25b0%259c%25eb%25b0%259c%25ec%259e%2590%25ec%259d%2598',3,'woowahan','2021-08-04 16:04:05'),(277,'가정의 달 이벤트가 쏘아올린 배민선물하기 대란.ssul','안녕하세요. 우아한형제들 배민선물하기팀에서 서비스기획을 담당하고 있는 진예령입니다. 기술블로그는 처음이지만 저희만 알고 있기엔 살짝 억울한(?) 프로젝트가 있어서 스리슬쩍 프로젝트 하나를 공유해보려고 합니다. 😂 저는 원래 프랜차이즈시스템팀에서 브랜드관 기획을 맡고 있었는데요. 작년 10월을 전후로 팀원 전체가 배민서비','https://techblog.woowahan.com/5073/?utm_source=rss&utm_medium=rss&utm_campaign=%25ea%25b0%2580%25ec%25a0%2595%25ec%259d%2598-%25eb%258b%25ac-%25ec%259d%25b4%25eb%25b2%25a4%25ed%258a%25b8%25ea%25b0%2580-%25ec%258f%2598%25ec%2595%2584%25ec%2598%25ac%25eb%25a6%25b0-%25eb%25b0%25b0%25eb%25af%25bc%25ec%2584%25a0%25eb%25ac%25bc%25ed%2595%2598%25ea%25b8%25b0-%25eb%258c%2580%25eb%259e%2580-ssul',3,'woowahan','2021-07-23 17:10:50'),(278,'우아~한 장애대응','안녕하세요. 우아한형제들 시스템신뢰성개발팀 박주희입니다. 얼마 전에 시스템신뢰성개발팀에 대해서 소개한 적이 있습니다. 그때, 팀 소개에서 시스템신뢰성개발팀에서 가장 중요한 업무 중 하나는 장애 대응이라고 설명했는데, 오늘은 이 장애 대응에 대해서 조금 더 자세하게 설명해보려고 합니다. 우아한형제들에게 장애란? 많은 서비스','https://techblog.woowahan.com/4886/?utm_source=rss&utm_medium=rss&utm_campaign=%25ec%259a%25b0%25ec%2595%2584%25ed%2595%259c-%25ec%259e%25a5%25ec%2595%25a0%25eb%258c%2580%25ec%259d%2591',3,'woowahan','2021-06-30 18:13:16'),(279,'우테코에서 찾은 나만의 효과적인 공부법','안녕하세요. 테크코스교육개발팀 이원미입니다. 3기 크루들의 두 번째 방학 (부럽습니다..) 을 앞두고 레벨 2를 마무리하며 작성한 글을 공유합니다 : ) 이번 글쓰기의 주제는 \"우테코에서 찾은 나만의 효과적인 공부법\" 입니다. 우아한테크코스에서는 정해진 답이 없는 학습 방법을 정답이라며 알려주거나, 그를 통해 크루들을 일','https://techblog.woowahan.com/4159/?utm_source=rss&utm_medium=rss&utm_campaign=%25ec%259a%25b0%25ed%2585%258c%25ec%25bd%2594%25ec%2597%2590%25ec%2584%259c-%25ec%25b0%25be%25ec%259d%2580-%25eb%2582%2598%25eb%25a7%258c%25ec%259d%2598-%25ed%259a%25a8%25ea%25b3%25bc%25ec%25a0%2581%25ec%259d%25b8-%25ea%25b3%25b5%25eb%25b6%2580%25eb%25b2%2595-2',3,'woowahan','2021-06-11 09:00:51'),(280,'우아한형제들 기획자 소개와 개발자와의 협업문화 인터뷰','끊임없이 도전하고 혁신하는 우아한형제들!그 중심에는 가치 있는 서비스를 설계하며‘좋은 것을 더 좋게’ 만들기 위해 도전하는 기획자분들이 있습니다. 이번 인터뷰에서는 기획자분들을 만나보겠습니다. 들어가기 전에 안녕하세요, 인터뷰로 다시 찾아온 인재영입팀 입니다.이번에는 두 가지 컨셉의 인터뷰를 진행하였습니다. 첫 번째 컨셉','https://techblog.woowahan.com/4122/?utm_source=rss&utm_medium=rss&utm_campaign=%25ec%259a%25b0%25ec%2595%2584%25ed%2595%259c%25ed%2598%2595%25ec%25a0%259c%25eb%2593%25a4-%25ea%25b8%25b0%25ed%259a%258d%25ec%259e%2590-%25ec%2586%258c%25ea%25b0%259c%25ec%2599%2580-%25ea%25b0%259c%25eb%25b0%259c%25ec%259e%2590%25ec%2599%2580%25ec%259d%2598-%25ed%2598%2591%25ec%2597%2585%25eb%25ac%25b8%25ed%2599%2594',3,'woowahan','2021-06-07 15:30:00'),(281,'우아한형제들 Developer Relations-Updated','2021년 4월 1일 만우절 거짓말같이 우아한형제들 조직도에 Developer Relations(DR 파트)가 등장합니다. (두둥!) DR 1호인 제가 입사한지 2년 하고도 3개월, DR 2호가 입사한지 만 1년 그리고 DR 3호의 입사가 한 달 남은 그 시점에서요 🙂 저는 늘 우아한형제들 구성원이었지만 조직도에 내가 ','https://techblog.woowahan.com/4091/?utm_source=rss&utm_medium=rss&utm_campaign=%25ec%259a%25b0%25ec%2595%2584%25ed%2595%259c%25ed%2598%2595%25ec%25a0%259c%25eb%2593%25a4-developer-relations-updated',3,'woowahan','2021-04-28 13:00:00'),(282,'[모집] 2021우아한테크캠프 4기','우아한개발자가 되고 싶은 이들을 위한 우아한테크캠프 4기를 소개합니다. 우아한테크캠프는 여름 방학기간을 활용해 진행되는 채용 연계형 교육 프로그램입니다. 교육은 사회적 상황에 따라 온라인 혹은 온/오프라인 병행 등 안전하고 유연한 교육방식을 준비하고 있습니다. 올해 4회차를 맞는 우아한테크캠프는 어떤 특징이 있나? 🏝 ','https://techblog.woowahan.com/2724/?utm_source=rss&utm_medium=rss&utm_campaign=%25eb%25aa%25a8%25ec%25a7%2591-2021%25ec%259a%25b0%25ec%2595%2584%25ed%2595%259c%25ed%2585%258c%25ed%2581%25ac%25ec%25ba%25a0%25ed%2594%2584-4%25ea%25b8%25b0',3,'woowahan','2021-04-20 13:00:00'),(283,'퇴사 부검','안녕하세요 (구) 배달의민족 정산시스템팀 개발자, (현) 유튜브 크리에이터 이동욱입니다. 제가 2021년 4월 19일(월) 퇴사를 합니다. 퇴사에 대한 이야기를 개인적으로 운영하는 유튜브 채널에 부검 발표를 했는데요. (배달의민족 개발자 퇴사썰 – 부검 발표 시작합니다.) 이 영상을 보시고 기술 블로그에 진심이신 분의 연','https://techblog.woowahan.com/2723/?utm_source=rss&utm_medium=rss&utm_campaign=%25ed%2587%25b4%25ec%2582%25ac-%25eb%25b6%2580%25ea%25b2%2580',3,'woowahan','2021-04-18 08:30:00'),(284,'제모옥은 젠킨스 조회로직 개선으로 하겠습니다. 근데 이제 비동기를 곁들인','제목의 밈은 조림요정의 휴먼강록체입니다. Intro 평화로운 2020년 9월의 어느 날… 데일리 미팅을 마치고 일감을 정리하던 저에게 한 가지 요청이 들어왔습니다. \"우빈님 여기 로직이 오래 걸리면 90초 넘게 걸리고 있는데 한번 개선할 수 있을지 확인 부탁드려요.\" ‘읭 아니 대체 어떤 레거시길래 90초씩이나 걸리는거야','https://techblog.woowahan.com/2722/?utm_source=rss&utm_medium=rss&utm_campaign=%25ec%25a0%259c%25eb%25aa%25a8%25ec%2598%25a5%25ec%259d%2580-%25ec%25a0%25a0%25ed%2582%25a8%25ec%258a%25a4-%25ec%25a1%25b0%25ed%259a%258c%25eb%25a1%259c%25ec%25a7%2581-%25ea%25b0%259c%25ec%2584%25a0%25ec%259c%25bc%25eb%25a1%259c-%25ed%2595%2598%25ea%25b2%25a0%25ec%258a%25b5%25eb%258b%2588%25eb%258b%25a4-%25ea%25b7%25bc',3,'woowahan','2021-04-06 13:00:00'),(285,'국제화(i18n) 자동화 가이드','# 국제화(i18n) 자동화 가이드\n\n글로벌을 무대로 서비스하는 웹 애플리케이션은 국제화(i18n)가 필수다. 이를 위하여 국제화 라이브러리를 사용하거나 직접 구현하기도 한다. 이 글은 국제화 지원을 위한 개발과 번역 과정에서 이른바 \"복붙\"이나 반복적인 수작업으로 인해 고통받는 모든 프런트엔드 개발자를 위하여 작성하였다','https://meetup.toast.com/posts/295',5,'nhn','2021-08-17 10:40:29'),(286,'모킹 통합관리와 cypress의 모킹 on/off 기능','# 모킹 통합관리와 cypress의 모킹 on/off 기능 \n\n모킹 데이터는 테스트를 실행하기 위해 실제 데이터가 아닌 개발자가 필요에 의해서 만든 데이터를 말한다. 그렇다면 모킹 데이터를 사용하는 목적은 무엇일까? \n\n- e2e 테스트 환경에서 실제 데이터가 유동적으로 변경돼서 기댓값을 비교하기 어려운 경우 \n- UI ','https://meetup.toast.com/posts/294',5,'nhn','2021-08-02 17:43:00'),(287,'Chromium이 발표한 RenderingNG가 무엇인가?','# Chromium이 발표한 RenderingNG가 무엇인가?\n\n필자는 현재 프런트엔드 개발자지만 Webkit 기반의 브라우저를 개발한 적이 있다. 주로 HTML5 스펙 지원과 각종 CSS 기능을 지원하기 위해 렌더링 엔진을 다양한 운영체제에 맞게 포팅하는 것이었다. 렌더링 엔진의 추상화된 레이어는 동일하지만, 실제 장치','https://meetup.toast.com/posts/293',5,'nhn','2021-07-16 10:53:46'),(288,'EasyCache의 Multi Replica 기능 소개','`EasyCache` 서비스는 사용자가 직접 `Redis`를 설치하지 않고도 클라우드 환경에서 쉽게 이용할 수 있도록 해주는 `NHN Cloud`의 KVS 서비스입니다.\n이번에 `EasyCache` 서비스에 새롭게 추가된 멀티 레플리카 기능에 대해 알아보도록 하겠습니다.\n\n## 복제 그룹과 레플리카 노드\n\n`EasyCac','https://meetup.toast.com/posts/292',5,'nhn','2021-07-15 16:55:38'),(289,'우리의 Thread는 왜 이렇게 부자가 되었을까?','안녕하세요. \nNHN Cloud 서비스에서 공통적으로 사용되는 Framework(결제, 인증, 권한 등)를 개발하고 있는 프레임워크개발팀 박시우입니다. \n최근 저희 팀에서 OOM 이슈 관련하여, 분석해 본 결과 병렬 처리 진행을 위해 ForkJoinPool을 사용하게 되면서 겪은 이슈에 대해 공유드리고자 합니다. \n발생 ','https://meetup.toast.com/posts/291',5,'nhn','2021-07-12 18:30:10'),(290,'게으른 개발자의 코딩 방법: AI주도 개발방법론','## 프롤로그 \n\n4차 산업혁명시대로 불리는 현재, 우리는 AI가 대중화된 시대에 살고 있다. 그리고 업무에도 깊숙하게 AI는 적용되고 있다. 과거부터 사무 처리 업무의 자동화는 관심거리였고, 매크로, RPA(Robotic Process Automation) 등으로 표현되며 사무 자동화도 계속 발전하며, 업무 처리의 효율','https://meetup.toast.com/posts/290',5,'nhn','2021-07-09 13:53:28'),(291,'뼈대 있는 가문의 데이터로 만들기','데이터 처리, 집계, 모델링 업무를 수행하다 보면 인지하지 못하는 복잡한 상관관계가 만들어지게 됩니다.\n특히 테이블이라고 표현되는 Relational Database의 DataSet들은 조회 용으로 쓰이는 경우도 있지만 \n많은 경우 다른 DataSet의 입력이 되거나 참조하는 meta성 데이터가 되기도 합니다.\n\n그러다 ','https://meetup.toast.com/posts/289',5,'nhn','2021-07-08 11:13:24'),(292,'Terraform: IaC의 단짝','## 목차\n\n* Terraform과 IaC\n* Terraform 설치\n* 준비\n* 인프라 구축\n* 인프라 변경\n* 인프라 제거\n* 그래프\n\n\n## 개요 \n\n훌륭한 IaC(Infrastructure as Code) 도구인 Terraform을 사용하여 NHN Cloud의 리소스(서버 인스턴스 등)를 만들고 변경하고 제거하는 ','https://meetup.toast.com/posts/288',5,'nhn','2021-07-05 18:32:54'),(293,'NAT 게이트웨이 기능 소개','# NAT 게이트웨이 \n## 기본 사항 \n* NAT 게이트웨이를 이용하면 인터넷 게이트웨이가 연결되지 않은 인스턴스들이 특정 CIDR에 대해서 인터넷 액세스를 할 수 있습니다. \n* NAT 게이트웨이는 고정된 소스 IP로 인터넷을 액세스 합니다. 특정 소스 IP에 대해서만 내부 접근을 허용하는 방화벽 정책을 운영하는 경우','https://meetup.toast.com/posts/287',5,'nhn','2021-07-02 11:27:11'),(294,'Github Actions으로 배포 자동화하기','# Github Actions으로 배포 자동화하기 \n\n![1.png](https://image.toast.com/aaaadh/real/2021/techblog/1%2818%29.png)\n\n## Github Actions이란? \n\n`Github Actions`이란 Github에서 제공하는 워크플로우(workflow)를 자동','https://meetup.toast.com/posts/286',5,'nhn','2021-07-02 10:48:10'),(295,'검색 영역 탐색을 위한 인덱싱 플랫폼의 변천사','-프롤로그검색은 고객이 쿠팡에서의 여정을 시작하는 주요 통로다. 검색 경험은 고객이 ‘쿠팡 없이 어떻게 살았을까?’ 라고 묻는 세상을 만들기 위해, 쿠팡이 달성해야 하는 미션의 핵심이다. 쿠팡 검색엔진의 목표는 고객 검색 키워드를 기반으로 최고의 프로덕트(연관상품, 랭킹, 상품평, 가격, 브랜드)를 제공하는 것이다. 관련','https://medium.com/coupang-tech/%EA%B2%80%EC%83%89-%EC%98%81%EC%97%AD-%ED%83%90%EC%83%89%EC%9D%84-%EC%9C%84%ED%95%9C-%EC%9D%B8%EB%8D%B1%EC%8B%B1-%ED%94%8C%EB%9E%AB%ED%8F%BC%EC%9D%98-%EB%B3%80%EC%B2%9C%EC%82%AC-eec241758e84?source=rss----fb028911af07---4',6,'coupang','2020-05-07 15:59:50'),(296,'당근마켓 팀과 데이터 분석','프로덕트 데이터 분석가는 어떤 일을 하는가안녕하세요 당근마켓 중고거래팀 그로스파트에서 데이터 분석을 하고 있는 매튜라고 해요.당근마켓은 월 1500만 명이 쓰는 서비스로 성장했어요. 당근마켓은 기능적으로 보면 중고거래 서비스이지만, 커뮤니티의 성격을 많이 가지고 있어요. 당근마켓의 사용자는 상당히 자주 당근마켓을 방문하고','https://medium.com/daangn/%EB%8B%B9%EA%B7%BC%EB%A7%88%EC%BC%93-%ED%8C%80%EA%B3%BC-%EB%8D%B0%EC%9D%B4%ED%84%B0-%EB%B6%84%EC%84%9D-b3d5af6159bc?source=rss----4505f82a2dbd---4',7,'daangn','2021-08-17 12:18:43'),(297,'당근런치를 만들어봤어요.','당근런치를 만들어봤어요때는 2021년 5월,당근마켓 iOS팀에서는 엔터프라이즈 배포를 한창 준비중이었어요.당근마켓 iOS팀에서 애플측에 사내에서 사용할 서비스를 제공하기 위해 엔터프라이즈를 신청 했었고, 어떤 사내 서비스를 만들어 볼지 동료들이 같이 고민을 했었어요.제 머릿속에는 항상? 재미난 짓을 벌일 마구니?가 잔뜩끼','https://medium.com/daangn/%EB%8B%B9%EA%B7%BC%EB%9F%B0%EC%B9%98%EB%A5%BC-%EB%A7%8C%EB%93%A4%EC%96%B4%EB%B4%A4%EC%96%B4%EC%9A%94-18c368552da6?source=rss----4505f82a2dbd---4',7,'daangn','2021-08-09 10:51:30'),(298,'네이티브 개발자와 함께하는 피드 서비스 설계하기','지난 4년전에 Vingle재직 당시 Texture를 기반으로 피드 퍼포먼스를 개선 했던 적이 있었어요. 당시 기억과 추억들 되돌아보니 감회가 새롭네요 :]Improvement feed performance with Texture(AsyncDisplayKit)초기에 당근마켓 피드는 UITableView기반으로 cell si','https://medium.com/daangn/%EB%84%A4%EC%9D%B4%ED%8B%B0%EB%B8%8C-%EA%B0%9C%EB%B0%9C%EC%9E%90%EC%99%80-%ED%95%A8%EA%BB%98%ED%95%98%EB%8A%94-%ED%94%BC%EB%93%9C-%EC%84%9C%EB%B9%84%EC%8A%A4-%EC%84%A4%EA%B3%84%ED%95%98%EA%B8%B0-6c5a5aa2b11f?source=rss----4505f82a2dbd---4',7,'daangn','2021-08-09 10:48:25'),(299,'당근마켓) XcodeGen 에서 Tuist 로 전환하기','오늘은 당근마켓 iOS 프로젝트 구성 툴을 XcodeGen 에서 Tuist 로 전환하게 된 이야기를 해보려고 합니다.Tuist 는 Swift 로 작성된 Xcode 관리 툴입니다. XcodeGen 과 비슷한 점이 많지만 프로젝트 구성을 Swift 파일로 작성할 수 있고, 기능이 더 많다는 특징이 있습니다.기존 프로젝트먼저 ','https://medium.com/daangn/xcodegen-%EC%97%90%EC%84%9C-tuist-%EB%A1%9C-%EC%A0%84%ED%99%98%ED%95%98%EA%B8%B0-3f0156e0c2ea?source=rss----4505f82a2dbd---4',7,'daangn','2021-07-22 14:15:56'),(300,'당근마켓 iOS 프로젝트에 XcodeGen 도입하기','XcodeGen Logo최근 당근마켓에 합류하면서 프로젝트 개선을 위한 여러 작업을 진행했습니다. 이번 글에서는 XcodeGen 을 도입하게 된 배경과 그 과정에 대해 적어보려고 합니다.XcodeGen 은 Project Spec 에 따라 Xcode 프로젝트를 생성해주는 툴입니다.배경iOS 개발을 하게 되면 필연적으로 만나','https://medium.com/daangn/%ED%94%84%EB%A1%9C%EC%A0%9D%ED%8A%B8%EC%97%90-xcodegen-%EB%8F%84%EC%9E%85%ED%95%98%EA%B8%B0-d0fd54691aad?source=rss----4505f82a2dbd---4',7,'daangn','2021-07-22 14:15:28'),(301,'당근마켓 AI의 데이터 활용 방법','당근마켓 서비스에 딥러닝 기술을 처음 도입한지 어느새 5년째가 되었어요. 그동안 빠르게 성장하는 서비스에 머신러닝을 적용하면서 데이터 관점이 어떻게 발전되어 왔는지 소개해드리고 싶어 오랜만에 작성해봐요.수작업 데이터 라벨링의 한계머신러닝 모델을 도입하기 우선 간단하게 현재 쌓여 있는 데이터에서 수작업으로 적절한 양의 학습','https://medium.com/daangn/%EB%8B%B9%EA%B7%BC%EB%A7%88%EC%BC%93-ai%EC%9D%98-%EB%8D%B0%EC%9D%B4%ED%84%B0-%ED%99%9C%EC%9A%A9-%EB%B0%A9%EB%B2%95-e5aeac08bc57?source=rss----4505f82a2dbd---4',7,'daangn','2021-05-21 17:17:46'),(302,'사용자와 함께하는 당근마켓 마케팅 이야기','“혹시, 당근이세요?”오늘은 오랜만에 당근마켓 마케팅 이야기에 대해 써볼까 합니다.최근 방영된 MBC ‘놀면뭐하니?’에서 당근마켓과 함께한 ‘위드유’편이 화제였죠. 당근마켓을 통해 동네에서 ‘함께 고기 먹을 이웃을 만난 장면’은 뜻밖의 재미를 주었고, ‘자전거 가르쳐줄 이웃을 만난 장면’은 많은 분들께 진한 감동을 드렸습','https://medium.com/daangn/%EC%82%AC%EC%9A%A9%EC%9E%90%EC%99%80-%ED%95%A8%EA%BB%98%ED%95%98%EB%8A%94-%EB%8B%B9%EA%B7%BC%EB%A7%88%EC%BC%93-%EB%A7%88%EC%BC%80%ED%8C%85-%EC%9D%B4%EC%95%BC%EA%B8%B0-50b7acf58dc1?source=rss----4505f82a2dbd---4',7,'daangn','2021-04-09 15:32:04'),(303,'풋내기 창업자의 스타트업 창업하기 11화_채용하기','풋내기 창업자의 스타트업 창업하기 12화_채용하기모든 스타트업의 가장 큰 고민 중 하나는 채용을 잘 하기입니다. 지금까지 5년동안 300번이 넘는 면접을 보면서 여전히 어떻게 하면 채용을 더 잘 할 수 있을까 고민을 하고 있지만 가장 기본적인 질문 중 하나는 “ 이 사람과 일하고 싶은가?”입니다.이 질문에는 사실 많은 질','https://medium.com/daangn/%ED%92%8B%EB%82%B4%EA%B8%B0-%EC%B0%BD%EC%97%85%EC%9E%90%EC%9D%98-%EC%8A%A4%ED%83%80%ED%8A%B8%EC%97%85-%EC%B0%BD%EC%97%85%ED%95%98%EA%B8%B0-11%ED%99%94-%EC%B1%84%EC%9A%A9%ED%95%98%EA%B8%B0-f919e45032f?source=rss----4505f82a2dbd---4',7,'daangn','2021-01-11 00:12:52'),(304,'이미지 분류 모델 AutoML 파이프라인','이미지 분류 모델 개발 AutoML 활용하기올해 3분기 당근마켓에서 Google Cloud AutoML을 활용하여 이미지 분류 모델을 개발하고 파이프라인 자동화한 사례를 공유 하려고 해요.프로젝트의 시작당근마켓 사용자가 서비스에 접속 했을때 시각적으로 가장 큰 영향을 주는 요소는 “사진”이에요. 앱에서 게시글을 확인할때 ','https://medium.com/daangn/%EC%9D%B4%EB%AF%B8%EC%A7%80-%EB%B6%84%EB%A5%98-%EB%AA%A8%EB%8D%B8-automl-%ED%8C%8C%EC%9D%B4%ED%94%84%EB%9D%BC%EC%9D%B8-68beb1ff15bf?source=rss----4505f82a2dbd---4',7,'daangn','2020-12-08 09:40:33'),(305,'풋내기 창업자의 스타트업 창업하기 11화 — 해외시장 진출','풋내기 창업자의 스타트업 창업하기 11화 — 해외시장 진출페북의 MAU 그래프입니다. 2004년 2월에 창업한 페북은 3년만에 MAU가 12백만명을 달성합니다. 당근마켓이 창업 5년반에 이룬 MAU 입니다. 하지만 페북은 2008년부터 사용자가 비약적으로 증가하기 시작합니다. 2008년에 1억명이 넘더니 그 다음해는 3억','https://medium.com/daangn/%ED%92%8B%EB%82%B4%EA%B8%B0-%EC%B0%BD%EC%97%85%EC%9E%90%EC%9D%98-%EC%8A%A4%ED%83%80%ED%8A%B8%EC%97%85-%EC%B0%BD%EC%97%85%ED%95%98%EA%B8%B0-11%ED%99%94-%ED%95%B4%EC%99%B8%EC%8B%9C%EC%9E%A5-%EC%A7%84%EC%B6%9C-6d735072deb9?source=rss----4505f82a2dbd---4',7,'daangn','2020-11-09 04:09:33'),(306,'추천 서비스가 컨테이너를 만났을 때-Part 1','안녕하세요. 왓챠에서 ML 소프트웨어 엔지니어로 일하고 있는 찰스입니다.여러분이 생각하는 좋은 추천 서비스는 어떤 서비스일까요? 사용자의 숨겨진 의도를 파악하여 추천하는 서비스? 추천을 통해 사용자의 재방문율을 높이는 서비스? 아마 많은 분들이 추천의 정확도와 관련된 기준을 먼저 생각하실 겁니다. 저는 추천의 정확도를 높','https://medium.com/watcha/part-1-%EC%B6%94%EC%B2%9C-%EC%84%9C%EB%B9%84%EC%8A%A4%EA%B0%80-%EC%BB%A8%ED%85%8C%EC%9D%B4%EB%84%88%EB%A5%BC-%EB%A7%8C%EB%82%AC%EC%9D%84-%EB%95%8C-f886d0f08df?source=rss----bd1678892a27---4',8,'watcha','2021-08-18 17:04:46'),(307,'웹브라우저에서 동작하는 녹화앱 만들기','안녕하세요. 왓챠 FE팀에서 웹 프론트엔드 개발을 하는 프레드입니다.최신 웹브라우저에서는 오디오, 이미지, 비디오 데이터를 저장하고 조작할 수 있는 API를 제공합니다. 이번 글에서는 웹브라우저에서 제공하는 API를 사용하여 간단하게( 100줄 이내의 자바스크립트 코드) 녹화 기능을 구현하는 방법을 소개합니다.예제를 통해','https://medium.com/watcha/%EC%9B%B9%EB%B8%8C%EB%9D%BC%EC%9A%B0%EC%A0%80%EC%97%90%EC%84%9C-%EB%8F%99%EC%9E%91%ED%95%98%EB%8A%94-%EB%85%B9%ED%99%94%EC%95%B1-%EB%A7%8C%EB%93%A4%EA%B8%B0-70142ce28994?source=rss----bd1678892a27---4',8,'watcha','2021-08-13 16:20:59'),(308,'WATCHA K8S 전환 -PART 2','PART 2 — Api-Gateway 소개NOTICE해당 블로그 는 PART 2 — Api-Gateway 소개 입니다.총 3 PART 의 시리즈로 구성했으며 아래와 같습니다.PART 1 — 전반적인 소개 및 POD 내 CONTAINER 알아보기PART 2 — Api-Gateway 소개PART 3 — GitOps 소개개요안','https://medium.com/watcha/watcha-k8s-%EC%A0%84%ED%99%98-part-2-caea323da57d?source=rss----bd1678892a27---4',8,'watcha','2021-08-04 16:58:01'),(309,'브라우저에서 미디어 권한을 다루는 간단 tip','WATCHA의 웹 프론트엔드 개발자 Angie입니다.지난 포스트에서 왓챠의 같이 보기 서비스, 왓챠파티 전반적인 개발기를 다루어보았는데요.오늘은 왓챠파티에서 새롭게 선보일 음성 코멘터리(Commentary: 파티 호스트가 작품에 대해 이야기하고 참여자들은 호스트의 음성을 들을 수 있는 기능, 이하 코멘터리)를 개발하며 마','https://medium.com/watcha/%EB%B8%8C%EB%9D%BC%EC%9A%B0%EC%A0%80%EC%97%90%EC%84%9C-%EB%AF%B8%EB%94%94%EC%96%B4-%EA%B6%8C%ED%95%9C%EC%9D%84-%EB%8B%A4%EB%A3%A8%EB%8A%94-%EA%B0%84%EB%8B%A8-tip-ee9e42ce9cb1?source=rss----bd1678892a27---4',8,'watcha','2021-07-28 16:44:03'),(310,'WATCHA K8S 전환 -PART 1','PART 1- 전반적인 소개 및 POD 내 CONTAINER 알아보기NOTICE해당 블로그 는 PART 1- 전반적인 소개 및 POD 내 CONTAINER 알아보기 입니다.총 3 PART 의 시리즈로 구성했으며 아래와 같습니다.PART 1 - 전반적인 소개 및 POD 내 CONTAINER 알아보기PART 2 - Api-G','https://medium.com/watcha/watcha-k8s-%EC%A0%84%ED%99%98-part-1-3ac7193d04d7?source=rss----bd1678892a27---4',8,'watcha','2021-07-21 17:07:05'),(311,'리액트18 버전에 추가되는 기능','새롭게 추가되는 기능들은 기존의 어떤 문제점들을 해결해줄 수 있을까?안녕하세요 단테입니다.프론트엔드 개발에 관심이 있는 분들은 오늘의 주제에 큰 흥미를 느끼실 수 있을 것 같습니다.21년 6월 8일, 리액트 코어 개발자들이 리액트 공식 홈페이지에 리액트 18에 새롭게 추가되는 기능들을 소개했습니다.또한 React18 Wo','https://medium.com/watcha/%EB%A6%AC%EC%95%A1%ED%8A%B818-%EB%B2%84%EC%A0%84%EC%97%90-%EC%B6%94%EA%B0%80%EB%90%98%EB%8A%94-%EA%B8%B0%EB%8A%A5-5901903e6fc2?source=rss----bd1678892a27---4',8,'watcha','2021-07-07 17:23:54'),(312,'협업의 조건','Ziggy가 생각하는 협업이 잘 되는 조직과 체크리스트왓챠에 PM직군으로 얼마 전 합류한 Ziggy가 ‘협업이 잘 되는 조직’에 대해 개인블로그에 글을 발행했어요. 왓챠와 함께하기 시작한 시점에 이전 경험들을 바탕으로 정리한 Ziggy의 생각을 만나볼까요?애자일하게 일하자는 얘기가 유행을 넘어서 일 잘한다는 조직의 대세로','https://medium.com/watcha/%ED%98%91%EC%97%85%EC%9D%98-%EC%A1%B0%EA%B1%B4-2937117f112d?source=rss----bd1678892a27---4',8,'watcha','2021-07-02 12:00:12'),(313,'Wasm 간단 사용기','2015년에 WebAssembly(이하 wasm)가 탄생하고 2017년에 주요 브라우저에서 wasm 을 사용할 수 있게 된 이후로 다양한 방법으로 wasm 가 사용되고 있습니다.대부분의 웹 프론트 개발자가 wasm 에 흥미를 느끼는 이유는 빠른 성능 때문일 거라고 생각합니다. 저 또한 그러한데요. 그래서 wasm 를 어떻','https://medium.com/watcha/wasm-%EA%B0%84%EB%8B%A8-%EC%82%AC%EC%9A%A9%EA%B8%B0-d2e14c760a0d?source=rss----bd1678892a27---4',8,'watcha','2021-06-23 17:20:11'),(314,'무슨 일 하고 계세요? #데이터사이언스팀','왓챠를 가장 잘 설명하는 단어는 무엇일까요? 왓챠 유저라면 아마 ‘영화’, ‘스트리밍’, ‘미드’, ‘중드’ 등의 콘텐츠와 관련된 단어나 ‘헐왓챠에’, ‘왓플릭스’ 등 이벤트를 꼽을테지만, 내부 직원들이 꼽는 왓챠를 가장 잘 설명하는 단어는 아마도 ‘데이터’일 것 입니다.왓챠의 창업 시점으로 거슬러 올라가면 그 이유를 알','https://medium.com/watcha/%EB%AC%B4%EC%8A%A8-%EC%9D%BC-%ED%95%98%EA%B3%A0-%EA%B3%84%EC%84%B8%EC%9A%94-%EB%8D%B0%EC%9D%B4%ED%84%B0%EC%82%AC%EC%9D%B4%EC%96%B8%EC%8A%A4%ED%8C%80-66cb1585ec83?source=rss----bd1678892a27---4',8,'watcha','2021-06-17 17:37:23'),(315,'좋아하는 것에 대하여 #4: 운동 덕후 Castle','“운동을 하면 기분이 조크든요 .”운동을 안 하는 이유는 거의 비슷하지만, 운동을 하는 사람은 저마다 다른 이유가 있다. 그중에서도 운동을 하면 기분이 좋다고 하는 캐슬은 진짜 운동 덕후다.기분이 좋아지는 것 말고도 운동을 하는 이유는 많다. 다음은 캐슬이 말하는 운동의 10가지 효능이다.기분이 좋아짐감각이 예민해지고 몸','https://medium.com/watcha/%EC%A2%8B%EC%95%84%ED%95%98%EB%8A%94-%EA%B2%83%EC%97%90-%EB%8C%80%ED%95%98%EC%97%AC-4-%EC%9A%B4%EB%8F%99-%EB%8D%95%ED%9B%84-castle-2767e10254d9?source=rss----bd1678892a27---4',8,'watcha','2021-05-20 16:34:19');
