INSERT INTO `question` VALUES (55,0,'안녕하세요! 코린이 입니다!\n\n제가 java를 배우고 있는데요!\n\n친구들이 javascript가 뭔지 아냐고 했는데.. 잘 몰라서요..\n\n혹시 java와 javascript의 차이점이 뭘까요?!\n\njava의 연장선인가요?\n\n배움이 짧아 여쭤봅니다 ㅠ','2021-08-19 10:15:33','Java와 JavaScript의 차이점이 뭔가요? 코린이입니다 ',0,'8HK63Z9CSQW10'),(56,0,'안녕하세요. split이랑 for문 연습 중인데 막힌 부분이 있어서요.\n```\n#1.\nfor i in range(len(df)) :\n    df_split1[i], df_split2[i]=df.loc[i].split(sep=\'.\', maxsplit=1)\n```\n\n```\n#2.\nfor i in range(len(df)) :\n    df.loc[i, \'c\']=str(df.loc[i, \'a\']).split(sep=\'.\', maxsplit=1)[0]\n    df.loc[i, \'d\']=str(df.loc[i, \'a\']).split(sep=\'.\', maxsplit=1)[1]\nError code : Too many indexers\n```\n\ndf 안에 ```asd.fgh``` 이런 형식으로 \'a\' column에 있어서 ```\'.\'```을 기준으로 split해서 앞과 뒤를 따로 저장을 하고 싶은데요. 1번으로 안되서 2번으로 했는데 ```\"Too many indexers\"``` 라는 에러가 나와서요.\n\nsplit을 사용해서 별도의 DataFrame을 만들거나 기존의 df에서 새로운 column을 추가해서 덧붙이고 싶은데 잘 안되네요.','2021-08-19 10:26:17','split, for문 이용해서 2개로 나누고 새로운 dataframe으로 저장하는 방법이 있나요?',0,'W963651S7589J'),(57,0,'파이썬에서 많이 사용하는 `round`함수를 사용하면 `round(1.5)`와 `round(2.5)`의 결과가 2로 같습니다. \n또한 자릿수를 표현해주는데 있어서 `round(1.000, 2)`의 값이 1.00이 아닌 1.0이 출력됩니다. 이러한 문제를 해결하기 위해 간단한 방법을 정리하려 합니다.\n\n`format`을 사용하면 이러한 문제를 해결할 수 있습니다.\n`print(\'{}\'.format(1.000, 2)}``1.0`,\n`print(\'{}\'.format(1.000, 2)}` `1.00`이 출력됨을 알 수 있습니다. \n\n두번째 방법은 함수를 직접 만들어 호출하는 것입니다.\n\n```\ndef roundUp(num):\n    if (num - int(num)) &amp;amp;amp;gt;= 0.5:\n        return int(num)\n    else:\n        int(num)\n\nprint(roundUp(2.5))\n```\n\n다른 방법으로는 decimal을 사용하는 방법입니다.\n```\nimport decimal\ncontext = decimal.getcontext()\ncontext.rounding = decimal.ROUND_HALF_UP\n\nprint(round(decimal.Decimal(\'2.5\'), 0))```\n\n','2021-08-19 10:37:22','파이썬 round 반올림 오류 해결 정리',0,'6OT8072V58Z5N'),(60,0,'```\nimport java.util.Random;\npublic class Compare {\n    public static void main(String[] args) {\n        int[] arr = new int[100];\n        Random rand = new Random();\n        for(int i = 0; i < arr.length; i++) {\n            arr[i] = rand.nextInt(100) + 1;\n        }\n        int[] ascSortedArr = new int[100];\n        ascSortedArr = ascBubbleSort(arr);\n        int[] decSortedArr = new int[100];\n        decSortedArr = decBubbleSort(arr);\n        for(int j = 0; j < arr.length; j++) {\n            System.out.println(ascSortedArr[j]);\n        }\n        for(int j = 0; j < arr.length; j++) {\n            System.out.println(decSortedArr[j]);\n        }\n    }\n    public static int[] ascBubbleSort(int[] arr) {\n        for(int i = 0; i < arr.length; i++) {\n            for(int j = 0; j < arr.length -1; j++) {\n                int temp;\n                if(arr[j] > arr[j + 1]) {\n                    temp = arr[j];\n                    arr[j] = arr[j + 1];\n                    arr[j + 1] = temp;\n                }\n            }\n        }\n        return arr;\n    }\n    public static int[] decBubbleSort(int[] arr) {\n        for(int i = 0; i < arr.length; i++) {\n            for(int j = 0; j < arr.length -1; j++) {\n                int temp;\n                if(arr[j] < arr[j + 1]) {\n                    temp = arr[j];\n                    arr[j] = arr[j + 1];\n                    arr[j + 1] = temp;\n                }\n            }\n        }\n        return arr;\n    }\n}\n```','2021-08-19 10:50:15','자바 변수가 조금 이상해요',0,'W963651S7589J'),(61,0,'웹에서 프론트쪽은 거의할줄알고 백엔드로도 배워보고싶은데 요새 트렌드인 개발툴이 뭔지랑 무슨책이 좋을지 질문드립니다!!','2021-08-19 10:51:32','웹앱 개발 초보자 책으로 뭐가좋을까요??',0,'8HK63Z9CSQW10'),(62,0,'```\n    public static void bin(int num) {\n        if(num>0) {\n            int bin;\n            bin = num % 2; \n            num/=2; \n            bin(num);\n            System.out.print(bin);\n        }\n    }\n    public static void main(String[] args) {\n        bin(10);\n    }\n```\n\n이게 코드인데 bin 메소드에서 출력전에 다시 bin 메소드를 출력하면, 2진수 결과값이 저장되는 bin이 다시 계산한 새로운 값으로 초기화 되는 거 아닌가요?? 왜 재귀 호출 후 출력하는지 이해가 되지 않습니다. 출력을 먼저 한 후 재귀 호출을하면 결과값이 다르더라구요..','2021-08-19 10:51:53','자바 2진수출력 재귀메소드인데 이해가 되지 않습니다.',0,'W963651S7589J'),(63,0,'### 긴급 !!!!\n\n```c\nusing namespace std; \nclass Graph { \n  public: \n  Graph(const int vertices = 0) :n(vertices) {}; \n  void ShortestPath(const int, int n); \n  int choose(const int); \n  int length[nmax][nmax]; \n  int dist[nmax]; \n  bool s[nmax]; \n  int n; \n}; \nvoid Graph::ShortestPath(const int v, int n) { \n  for (int i = 0; i < n; i++) { \n    s[i] = false; \n    dist[i] = length[v][i]; \n } \n s[v] = true; \n dist[v] = 0; \n for (int i = 0; i < n - 2; i++) { \n   int u = choose(n); \n   s[u] = true; \n   for (int w = 0; w < n; w++) \n   if (!s[w]) \n   if (dist[u] + length[u][w] < dist[w]) \n   dist[w] = dist[u] + length[u][w]; \n} \n} \n```\n\n그래프에서 각 노드들의 최단경로와 거리를 구하는 코드를 짜고있는데요  \n거리까지는 구해봤는데 경로를 출력하는부분에서 몇시간째 막혀버렸습니다.  \n마지막부분의 주석쳐놓은 곳이 잘못된거같은데 어떤방향으로 수정해야할지 알려주실분 계신가요? ㅠ\n','2021-08-19 10:55:08','c++ 최단경로 구하기 코드문제...',0,'ZBBEE3OA3N89L'),(64,0,'bst코드를 짜고있는데요 하나의 트리 객체를 생성하는 tree_create함수랑 그 안의 노드를 생성하는 node_create함수, 노드를 삽입하는 node_insert함수까지 구현했습니다  \n여기서 문제가 컴파일하고 실행하면   \n1. node_insert 함수의 tree->root 등의 노드들이 초기화되지 않아 예외발생(0xCDCDCDCD)  \n2. 노드들을 NULL값으로 초기화하고 실행하면 읽기액세스 위반 (nullptr였습니다)\n위 과정만 계속 반복중이네요... \n구조체 값을 NULL말고 다른값으로 초기화 해야하나요? 어떻게 해결할지 방향좀 알려주시면 감사하겠습니다 ㅠㅠ\n\n```c\nint lab2_node_insert(lab2_tree* tree, lab2_node* new_node) { \n  // You need to implement lab2_node_insert function. \n  lab2_tree* tmp; \n  lab2_tree* tmp2; \n  tmp = tree; \n  tmp2 = tree; \n  if (tmp->root->key == NULL) { \n    tmp->root = new_node; \n    tree = tmp; \n    tree->root = tmp2->root; \n    return 1; \n } \n```\n\n','2021-08-19 10:56:22','c언어 구조체 초기화,nullptr,0xCDCDCDCD 예외',0,'ZBBEE3OA3N89L'),(65,0,'지금 안드로이드로 날씨api를 받아와 받아온 값을 기준으로 (예를들면 특정한 값이 \"맑음\"이면) 이미지를 보여주는 과정을 진행중인데   \n현재 별다른 지식없이 곧바로 프로젝트에 투입되서 어떤 방법으로 접근해야할지 전혀 감이 안잡힙니다...  \napi를받아오는 자바 프로그램까지는 작성했는데 이를 Mainactivity에 배치해야할지 혹은 따로 클래스를 만들어야할지, 현재 한 화면에 여러개의 리니어레이아웃을 만든상태여서 사용자입력을받는 리스트뷰에 관한 oncreate메소드가 이미 존재하는데 이 곳에 합쳐야 할지...\n리니어레이아웃마다 각각 다른 액티비티를 수행할수 있는지... 별다른 진전없이 똑같은곳만 맴돌고있는 상황이에요 ㅠ  \n이런 상황에서 어떤식으로 프로그램을 구성해야할지 대략적으로만 알려주실분 계신가요?? ','2021-08-19 10:57:03','안드로이드스튜디오를통한 앱만들기 질문입니다...',0,'ZBBEE3OA3N89L'),(66,0,'vue를 공부하다가 궁금한 점이 생겨서 질문 남깁니다!\nwatch와 computed의 차이점이 무엇인가요? 어떤 상황에서 사용해야 할까요?','2021-08-19 10:58:37','watch와 computed의 차이점이 무엇인가요?',0,'6OT8072V58Z5N'),(68,0,'지금 작성중인 프로그램인데요...  \nstringF메소드의 조건문부분에서 계속 배열범위 오류가 발생합니다  \n근데 이 매소드를 스레드부분의 run()에서 호출할때는 문제없이 실행이되고 이를 확인할려고 출력까지 해보았으나 문제없이 정상출력이 되는데  \noncreate안의 wp메소드에서 호출하면 이런 오류가생깁니다 ㅠㅠ 어케해야할까요  \n각부분의 코드와 스레드에서 실행할때 정상출력되는스샷 첨부합니다  \n\n![errcapture](https://kin-phinf.pstatic.net/20200609_78/15916330852464Vg87_PNG/1591633085181.png?type=w750)','2021-08-19 10:58:59','안드로이드앱 작성중 배열범위초과오류',0,'ZBBEE3OA3N89L'),(69,0,'```java\nnew Thread(new Runnable() {\n\n@Override\n       public void run() {\n// TODO Auto-generated method stub\n           data = getXmlData();//아래 메소드를 호출하여 XML data를 파싱해서 String 객체로 얻어오기\n\n           //UI Thread(Main Thread)를 제외한 어떤 Thread도 화면을 변경할 수 없기때문에\n           //runOnUiThread()를 이용하여 UI Thread가 TextView 글씨 변경하도록 함\n            runOnUiThread(new Runnable() {\n@Override\n               public void run() {\n// TODO Auto-generated method stub\n                   textW.setText(data); //TextView에 문자열 data 출력\n               }\n            });\n        }\n    }).start();\n}\n```\n\n여기서 data는 외부에서 선언한 String 전역변수인데 왜 스레드 밖에서 호출하면 아무것도 안뜨나요\nrun에서 data를 리턴하는방법이 있나요? ㅠ','2021-08-19 11:00:24','안드로이드 자바 질문입니다...',0,'ZBBEE3OA3N89L'),(70,0,'안드로이드 스튜디오로 앱을 만들어서 이를 다른 기기에 설치하려고했으나\n\n계속 앱이 설치되지 않았습니다 라는 메세지가 뜨면서 설치가 안됩니다 \n\n구글 플레이스토어 프로텍트 해제해봤고 기존 앱도 삭제해봤는데 전혀 진전이없네요\n\n스튜디오에서 시뮬레이터로 실행시키면 문제없이 실행되고\n\n스마트폰을 pc에 직접 연결해서 디버깅할때도 문제없이 잘 실행되고 심지어 설치까지 되는데\n\n왜 apk추출한걸로 설치하려면 안되는걸까요 :D','2021-08-19 11:01:20','안드로이드 apk 앱이 설치되지 않았습니다',0,'ZBBEE3OA3N89L'),(72,0,'백준 7576문제에서 런타임 에러가 발생합니다.. 어떻게 해결하면 좋을까요?\n```\nfrom collections import deque\n\nN, M = map(int, input().split())\ntable = [list(map(int, input().split())) for _ in range(M)]\n\nque = deque([])\ndef bfs():\n    while que:\n        x, y = que.popleft()\n        for i in range(4):\n            nx = x + dx[i]\n            ny = y + dy[i]\n            if 0 <= nx < M and 0 <= ny < N and table[nx][ny] == 0:\n                que.append((nx, ny))\n                table[nx][ny] = table[x][y] + 1\n\n\ndx = [-1, 1, 0, 0]\ndy = [0, 0, -1, 1]\n\n\nfor i in range(M):\n    for j in range(N):\n        if table[i][j] == 1:\n            que.append([i, j])\n\nbfs()\n\nresult = 0\nfor i in table:\n    for j in i:\n        if j == 0:\n            print(-1)\n            exit(0)\n    result = map(result, max(i))\nprint(result - 1)\n```\n','2021-08-19 11:05:10','[파이썬] 백준 7576 문제 런타임 에러가 납니다!!',0,'6OT8072V58Z5N'),(73,0,'```\npackage javaprac;\nimport java.util.*;\npublic class hello {\n    public static void main(String[] args) {\n        Scanner scan = new Scanner(System.in);\n        int num;\n        double avg = 0;\n        System.out.println(\"학생수를 입력하시오\");\n        num = scan.nextInt();\n        int score[] = {0};\n        for (int i = 0; i; num; i++) {\n            System.out.println(\"학생\" + (i + 1) + \"의 성적을 입력하세요\");\n            score[i] = scan.nextInt();\n            if (score[i] 100) {\n                System.out.println(\"다시 입력하시오.\");\n            }else {\n                avg = avg + score[i];\n            }\n        }\n        System.out.println(\"성적평균은: \" + avg / num);\n    }\n}\n```\n코딩 내용은 학생수를 입력받아 학생수만 큼 점수를 입력해서 점수의 평균을 구하는 코딩입니다\n\n학생수를 1명으로 했을떄는 값이 제대로 나오는데 2명 이상일 경우 오류가나오네요 어디가 문제인지 친절히 가르쳐주세요.. 코딩 노베이스라... 죄송합니다.','2021-08-19 11:08:32','자바 소소한 코딩 질문 [ 배열]',0,'W963651S7589J'),(74,0,'최근 리눅스가 개발자에게 있어 가장 최적화 되어 있다는 이야기를 듣고 토이 프로젝트에서 리눅스를 활용해보고자 알아보게 되었습니다.\n\n그리고 뉴렉처 라는 유부버 분의 강의를 들으면서 리눅스에 대해 공부를 하였는데\n\n아무리 보고 구글링을 해도 리눅스를 OS로 두고 개발을 한 다는 것은 어떤 것을 한다는 것인지 이해가 안 갑니다..ㅠㅠ\n\nSpring boot로 맥 OS나 윈도우에서 코딩하는 것이 아닌 Virtual Box에 깔린 리눅스 컴퓨터를 시작해\n\n그 곳에 STS를 깔아 코딩을 한다는 것인지,\n\n아니면 맥 OS나 윈도우에서 코딩을 한 뒤에 war파일을 익스포트 한 다음\n\n이를 리눅스 OS에 파일을 위치시키는 것을 말하는 것인지\n\n잘 이해가 안됩니다..!\n\n리눅스 환경에서 개발한다는 것은 리눅스 OS에 IDE를 두고 개발하는 것인가요\n\n아니면 배포 파일을 리눅스 환경에 넣음으로써 이 말이 충족되는 것인가요..?','2021-08-19 11:10:29','리눅스 환경에서 개발한다는 것은 어떤 말인가요?',0,'8HK63Z9CSQW10'),(75,0,'제가 최근에 학원을 다녔는데 파이썬이랑 자바를 배우고 있습니다.\n\n둘다 스파이더, 이클립스란 프로그램을 사용합니다. 저는 VSCODE가 훨씬 편하고 UX가 깔끔해서 좋은데, 웬만한 학원들은 오래된 프로그램을 쓰는 것 같습니다.\n\n자바는 오래된 언어라 이해하는데 파이썬도 구형 프로그램으로 돌리니까 조금 스트레스 입니다. VSCODE가 훨씬 좋은데...\n\n혹시 자바도 VSCODE로 돌릴 수 있나요?\n\n여러분들의 최애 프로그램은 무엇이고 각자 어떤 언어를 주력으로 사용하시나요? 왜나만안되나요?제가 최근에 학원을 다녔는데 파이썬이랑 자바를 배우고 있습니다.','2021-08-19 11:12:44','여러분들의 최애 프로그램은 무엇이고 각자 어떤 언어를 주력으로 사용하시나요?',0,'629Q0LC8H2OC7'),(76,0,'```\nimport java.util.Scanner;\n\nclass Player{ String name; String answer; static String word = \"아버지\"; static int lastIndex = word.length()-1;\n\nvoid showPlayerName() {\n    System.out.println(name);\n}\n\nvoid showPlayerAnswer() {\n    System.out.println(answer);\n}\n\n int checkSuccess(String answer, char firstChar) {\n    if(word.charAt(lastIndex) == firstChar) {\n        word = answer;\n        lastIndex = word.length() - 1;\n        return 1;\n    }\n    else {\n        word = \"아버지\";\n        return 0;\n    }\n}\n}\n\npublic class WorldGameApp {\n\npublic static void main(String[] args) {\n    Scanner sc = new Scanner(System.in);\n    System.out.println(\"참가하는 사람의 수 입력 : \");\n    int gamers_num = sc.nextInt();\n    Player player[] = new Player[gamers_num];\n\n    for(int i = 0 ; i &amp;lt; gamers_num ; i++) {\n        System.out.println(\"\\n\" + (i+1) + \"번째 선수 이름 입력 : \");\n        player[i] = new Player();\n        player[i].name = sc.next();\n    }\n\n    System.out.println(\"==========================\");\n    System.out.println(\"끝말잇기 시작, 시작단어 : 아버지 \");\n\n    while(true) {\n\n        if(gamers_num == 1) \n            break;\n\n\n        else {\n\n            for(int i = 0 ; i  &amp;lt; gamers_num ; i++) {\n                System.out.println(\"==========================\\n\");\n                System.out.println(player[i].name + \" 차례\");\n\n                System.out.println(\"다음 낱말 입력 : \");\n                player[i].answer = sc.next();\n                String Answer = player[i].answer;\n                char Firstchar = Answer.charAt(0);\n\n                if((player[i].checkSuccess(Answer, Firstchar)) == 1)\n                    continue;\n\n                else {\n                    System.out.println(player[i].name + \"탈락\");                      \n                    for(int j = i ; j &amp;lt; gamers_num; j++) { //한명 탈락시 탈락자 배열에서 제거\n                        player[j] = player[j+1];\n                    }\n                    System.out.println(\"==========================\");\n                    System.out.println(\"끝말잇기 시작, 시작단어 : 아버지 \");\n```\n이부분까지 프린트가 되는데, 위의 for문 보듯이 `` 탈락자자리에 다음 사람 넣어주고 인원수 줄여서 player클래스 배열에는 탈락자는 빠진 상태로 저장이 되는데, 왜 그다음 게임은 진행하지 않나요? 문제가 있을까요?\n```\n                    gamers_num--; //게이머 숫자가 하나 감소\n\n                }\n\n            }\n        }   \n    }\n}\n```\n\n','2021-08-19 11:14:56','게이머 한명이 탈락 할때, 그 인원을 빼는것을 구현했는데 게이머 한명이 빠진채로 구현이 안됩니다.',0,'629Q0LC8H2OC7'),(80,0,'백엔드 프로그래머 희망자입니다.\n\n가장 중요한 역량은 무엇인가요?','2021-08-20 03:32:21','백엔드 프로그래머로 취업하고 싶은데 가장 중요한 역량이 무엇인가요?',0,'8HK63Z9CSQW10');
